import React, { Component, useState } from 'react';


class Counter extends Component {
    state = {
        num: 0
    }
     plus = (e) => {
        this.setState({
            num: this.state.num +1
        })
     }
     minus = (e) => {
        this.setState({
            num: this.state.num -1
        })
     }

    render() {
        return (
            <div>
                <h1>Counter</h1>
                <div>{this.state.num}</div>
                <button onclick={plus}>+</button>
                <button onclick={minus}>-</button>
            </div>
        )
    }
}

